  IsarWriter writer,
  List<int> offsets,
  Map<Type, List<int>> allOffsets,
) {
  writer.writeString(offsets[0], object.imagePath);
  writer.writeDouble(offsets[1], object.price);
  writer.writeLong(offsets[2], object.productId);
  writer.writeString(offsets[3], object.productName);
  writer.writeDouble(offsets[4], object.publicPrice);
  writer.writeLong(offsets[5], object.quantity);
}

OrderProduct _orderProductDeserialize(
  Id id,
  IsarReader reader,
  List<int> offsets,
  Map<Type, List<int>> allOffsets,
) {
  final object = OrderProduct(
    imagePath: reader.readStringOrNull(offsets[0]),
    price: reader.readDoubleOrNull(offsets[1]),
    productId: reader.readLongOrNull(offsets[2]),
    productName: reader.readStringOrNull(offsets[3]),
    publicPrice: reader.readDoubleOrNull(offsets[4]),
    quantity: reader.readLongOrNull(offsets[5]),
  );
  return object;
}

P _orderProductDeserializeProp<P>(
  IsarReader reader,
  int propertyId,
  int offset,
  Map<Type, List<int>> allOffsets,
) {
  switch (propertyId) {
    case 0:
      return (reader.readStringOrNull(offset)) as P;
    case 1:
      return (reader.readDoubleOrNull(offset)) as P;
    case 2:
      return (reader.readLongOrNull(offset)) as P;
    case 3:
      return (reader.readStringOrNull(offset)) as P;
    case 4:
      return (reader.readDoubleOrNull(offset)) as P;
    case 5:
      return (reader.readLongOrNull(offset)) as P;
    default:
      throw IsarError('Unknown property with id $propertyId');
  }
}

